text:
{'text': "I arrived at the restaurant and found it relatively empty with a few other diners. I was promptly seated and guided through the QR code ordering system. After placing my order, I waited for the food to arrive and paid at the end of the meal.

The sashimi was alright, with generously thick slices. However, I felt the provided soy sauce didn't enhance the flavour of the fish as much as I expected. I'm not sure if this was due to the thickness of the sashimi or the quality of the soy sauce.

It's worth noting that complimentary water is not provided. Overall, my dining experience was decent.", 'languageCode': 'en'}

